import React, { useEffect, useState } from 'react';
import api from '../services/api';

const Results: React.FC = () => {
	const [matches, setMatches] = useState<any[]>([]);

	useEffect(() => {
		const fetch = async () => {
			try {
				const res = await api.get('/matches/?status=COMPLETED');
				setMatches(res.data);
			} catch (err) {
				console.error(err);
			}
		};
		fetch();
	}, []);

	return (
		<div style={{ padding: 16 }}>
			<h2>Results</h2>
			{matches.length === 0 && <p>No completed matches yet.</p>}
			<ul>
				{matches.map(m => (
					<li key={m.id}>{`${m.fixture?.player1?.name || 'TBD'} vs ${m.fixture?.player2?.name || 'TBD'} — Winner: ${m.winner?.name || 'TBD'}`}</li>
				))}
			</ul>
		</div>
	);
};

export default Results;
